import suitInTheBackJPG from "./images/suit-in-the-back-quaker-city-night-hawks.jpg";
import highNoMoreJPG from "./images/high-no-more-hajaj.jpg";
import desireJPG from "./images/desire-warhaus.jpg";
import whiskeyJPG from "./images/whiskey-tejon-street-corner-thieves.jpg";

import oceansMP3 from "./songFiles/oceans-the-blue-stones.mp3";
